import React from 'react';

const Miles = (props) => {
    return (
        <div className="input-holder">
            <input type="text" 
                value={props.miles}
                onChange={props.handleMileChange}
                name="miles"
                placeholder="Must be a number" 
                className="mile-input"/>
        </div>
    )
}

export default Miles;
